import Link from "next/link";

const Menu = () => {
  return (
    <nav>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/design">
        <a>Design</a>
      </Link>
      <style jsx>{`
        nav {
          font-family: "Raleway";
          display: flex;
          flex-direction: column;
          width: auto;
          height: 100%;
          background-color: beige;
        }

        @media only screen and (max-width: 1024px) {
          nav {
            width: 100%;
          }
        }

        a {
          padding: 20px;
          color: black;
          font-size: 1.5em;
        }
        a:hover {
          background-color: black;
          color: white;
          text-decoration: none;
        }
      `}</style>
    </nav>
  );
};

export default Menu;
